tests.body:
function () {
    cy.get("@todos").eq(1).find(".toggle").check();
    cy.get(".clear-completed").click();
    cy.get("@todos").should("have.length", 2);
    cy.get(".todo-list li").eq(0).should("contain", TODO_ITEM_ONE);
    cy.get(".todo-list li").eq(1).should("contain", "XXXX");
  }

_afterAll.body:
function () {
      // Need to wait otherwise some last commands get omitted from logs.
      cy.task(CONSTANTS.TASK_NAME_OUTPUT, null, {log: false});
    }

